import { Table } from 'react-bootstrap'

const SeoTable = ({content}) => {

  const renderTable = () => {
    return (
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Username</th>
          </tr>
        </thead>
      </Table>
    )
  }

  return renderTable()
}

export default SeoTable
